  state = {
    name: 'shinan',
    age: 24
  }
  handleChange = (e) =>{
    this.setState({
      name: e.target.value
    });
  }
  summitForm = (e) => {
    console.log("log to console")
    e.prevent
  }
  render() {
    return (
      <div className="App">
      <h1> this is me  {this.state.name}</h1>
        <form onSubmit = {this.summitForm}> <input type = "text" onChange = {this.handleChange} /> 
        <button> Submit </button> 
        </form>

      </div>
    );
  }
}

export default App;
